import { Component } from '@angular/core';

@Component({
  selector: 'app-contact-us',
  templateUrl: './contact-us.component.html',
  styleUrls: ['./contact-us.component.scss']
})
export class ContactUsComponent {

}
<h1 style="text-align: center;margin-top: 5px;">Contact Us</h1>

<div class="container">
    <div class="row">
        Please use this contact form to get in touch with the Flipkart Stories team with regard to the content published on stories.flipkart.com only. Please note that complaints about products sold on Flipkart or customer support emails will not receive a response. For such issues, please tweet to @Flipkartsupport

    </div>
</div>
